Day by Day
Highlisting the top10 most played decks (at the moment of the last game played).






Note: It’s a bit surprising that Lulu/Zed was able to rank-up to the second most played deck in such low time.
Akshan/Sivir/Zed seems to be confirmed as the “Sivir deck of choice” and Draven/Ezreal continue to rise as the “anti-random” decks near a seasonal, if it works why change it afterall.
Overall no real surprised as the meta was stabilizing from almost two weeks, most of the differences can be explained by how there is no tier0 and lower-tier (in playrate) meta-decks are more neck to neck and able to push the overall results in different directions.
