Since I added the server-specific values it would have been wrong to ignore this also in this ‘Underdog’ section. I decided to leave the rule untouched, without taking in account the different servers. While for the “Meta Decks” it was more a natural expansion, here the results can widely differ by small changed and as mentioned in the past I would like to leave the current rule as much as possible unless it’s too broken. Of course one could complain as there decks whose results are mostly carried by a single server and/or not even played in the others.
All true, but there are limitation like the facrs that the asian server is very low on number during all the season so even the condition of a mininum of 50 games with playrate \(\in\) [0.1%,1%) is a lot screw the results. Also this section in not as the Meta Deck one where players are interested in seeing the performance of the most played decks but it’s meant to be a “look around there may be some dark tech that’s worth investing some time”.
A better solution would be ‘expanding’ this section or providing some tools to allows players to search the result. But there’s a problem, not providing immediate readable results and leave the research to the user is a bad choice in a report from my point of view at least and for sections like this one in particular. It could be worth exploring as a standalone option like the recently uploaded page for the MU table (MU-Table)


